[A person having origins in any of the original peoples of North and South America (including Central America) and who maintains tribal affiliation or community attachment; 
A person having origins in any of the original peoples of the Far East Southeast Asia or the Indian subcontinent including e.g. Cambodia China India Japan Korea Malaysia Pakistan the Philippine Islands Thailand and Vietnam; 
